/*Table structure for table `buoy` */

DROP TABLE IF EXISTS `buoy`;

CREATE TABLE `buoy` (
  `b_id` int(128) NOT NULL AUTO_INCREMENT,
  `date` varchar(128) DEFAULT NULL,
  `b_buoyid` varchar(128) DEFAULT NULL,
  `b_Mnum` varchar(128) DEFAULT NULL,
  `b_rw` varchar(128) DEFAULT NULL,
  `b_longitude` varchar(128) DEFAULT NULL,
  `b_latitude` varchar(128) DEFAULT NULL,
  `b_bearing` varchar(128) DEFAULT NULL COMMENT '方位',
  `b_voltage` varchar(128) DEFAULT NULL COMMENT '电压',
  `b_ridlight` varchar(128) DEFAULT NULL COMMENT '锚灯',
  `b_watpolice` varchar(128) DEFAULT NULL COMMENT '舱进水',
  `b_doorpolice` varchar(128) DEFAULT NULL COMMENT '舱门',
  `b_shift` varchar(128) DEFAULT NULL COMMENT '移位',
  `b_hatch` varchar(128) DEFAULT NULL COMMENT '舱盖',
  `b_plice` varchar(128) DEFAULT NULL,
  `b_ridlight_status` varchar(128) DEFAULT NULL,
  `b_watpolice_status` varchar(128) DEFAULT NULL,
  `b_shift_status` varchar(128) DEFAULT NULL,
  `b_free` varchar(128) DEFAULT NULL COMMENT '剩余空间',
  `b_sensor` varchar(128) DEFAULT NULL,
  `b_sensor_status` varchar(128) DEFAULT NULL,
  `b_sensor_police` varchar(128) DEFAULT NULL,
  `b_break_status` varchar(128) DEFAULT NULL,
  `b_datafrom` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`b_id`),
  KEY `date` (`date`,`b_buoyid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `buoy` */

/*Table structure for table `buoylog` */

DROP TABLE IF EXISTS `buoylog`;

CREATE TABLE `buoylog` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `date` varchar(128) DEFAULT NULL COMMENT '时间',
  `summary` varchar(512) DEFAULT NULL COMMENT '事件标题',
  `details` varchar(2000) DEFAULT NULL COMMENT '事件详情',
  `user_id` int(10) DEFAULT NULL COMMENT '处理人',
  PRIMARY KEY (`id`)
